import { Redirect } from 'react-router-dom';
import React from 'react';
import logo from './logo.svg';
import './App.css';
import Counter from './Counter';

function App() {
  return (
    <div className="App">
      <header className="App-header">
               <Counter/>

      </header>
      <Redirect to="/Counter" />
    </div>
  );
}


export default App;
